import React from "react";
import { Link } from "react-router-dom";

import {
  Button,
  Card,
  CardBody,
} from "reactstrap";

import {
  Form,
  Icon,
  Input,
  Item
} from "antd"

import Illu from "../../assets/img/photos/illustration-3.png";

class SignUp extends React.Component {
  constructor(){
    super()
    this.state ={
      subdomain: '',
      email: '',
      password: ''
    }
  }

  render(){
    return(
      <section class="section-border border-primary">
      <div class="container d-flex flex-column">
        <div class="row align-items-center justify-content-center no-gutters min-vh-100">
          <div class="col-8 col-md-6 col-lg-7 offset-md-1 order-md-2 mt-auto mt-md-0 pt-8 pb-4 py-md-11">
            <img src={Illu} alt="..." class="img-fluid"/>
          </div>
          <div class="col-12 col-md-5 col-lg-4 order-md-1 mb-auto mb-md-0 pb-8 py-md-11">
            <h1 class="mb-0 font-weight-bold text-center">
              Create Your Hub
            </h1>
            <p class="mb-6 text-center text-muted">
              Your Hub is your main control room. Target might name their Hub..Target
            </p>

            <Form>
              <Form.Item>
              <Input
                name='task_title'
                value={this.state.subdomain}
                size="large"
                placeholder="My Hub Name"
              />
              </Form.Item>
              <button class="btn btn-block btn-primary" type="submit">
                Create
              </button>
            </Form>



            <p class="mb-0 font-size-sm text-center text-muted">
              Already Have an Account? <Link to="/auth/sign-in">Sign in</Link>
            </p>

          </div>
        </div>
      </div>
    </section>
    )
  }
}


export default SignUp;
